import React, { Component } from 'react';

export class TaskContainer extends Component {
  renderTasks = () => {
    console.log(this.props.tasks);
  };

  render() {
    return (
      <div className='tasks'>
        <h5>Tasks</h5>
        {this.renderTasks()}
      </div>
    );
  }
}

export default TaskContainer;
